import React from "react";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
      <a className="navbar-brand" href="/">
        Raft1 Scheduler
      </a>
      <button
        onClick = {this.props.logOut}
      >Log Out</button>
    </nav>
  );
}

export default Nav;
